        <a href="mailto:s.nguyen11@utexas.edu" target="_blank" rel="noopener noreferrer"><i className="far fa-envelope"></i></a>
        <a href="https://www.instagram.com/serenanguyen_/" target="_blank" rel="noopener noreferrer"><i className="fab fa-instagram"></i></a>
        <a href="https://www.linkedin.com/in/serenanguyenatx/" target="_blank" rel="noopener noreferrer"><i className="fab fa-linkedin"></i></a>
    </div>
  )
}
